import React from 'react';
import { StyleSheet, Text, View, SafeAreaView } from 'react-native';
import {
  Container,
  Header,
  Content,
  Form,
  Item,
  Input,
  Label,
  Left,
  Right,
  Body,
  Title,
  Button,
  Icon,
} from 'native-base';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import FarmerScreen from './FarmerScreen';
import AuthenticatedScreen from '../auth/authenticatedScreen';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { color } from 'react-native-reanimated';



const LoginScreen = ({ navigation: { navigate } }) => {
  return (
    // <SafeAreaView>
    <Container>
      <Header>
        <Left />
        <Body>
          <Title>Login</Title>
        </Body>
        <Right />
      </Header>
      <Content>
        <Form>
          <Item floatingLabel>
            <Label>Email</Label>
            <Input />
          </Item>
          <Item floatingLabel>
            <Label>Password</Label>
            <Input />
          </Item>
          <Item floatingLabel>
            <Input disabled placeholder='Customer' />
          </Item>
        </Form>
        <Button
          full
          iconLeft
          onPress={() => navigate('MATERIAL_HOME')}
        >
          <Icon type='MaterialCommunityIcons' name='login' />
          <Text>Login</Text>
        </Button>
        <TouchableOpacity
          style={styles.toRegister}
          onPress={() => navigate('MATERIAL_REGISTER')}
        >
          <Text style={{ color: 'orange' }}>
            Don't have an account...Click Here
          </Text>
        </TouchableOpacity>
      </Content>
    </Container>
    // </SafeAreaView>
  );
};

const mapStateToProps = (state)=>({
  auth: state.auth
})

export default connect(mapStateToProps)(LoginScreen);

const styles = StyleSheet.create({
  toRegister: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingTop: 20,
  },
});
